@Override
public boolean collect(String term, int count) {
  if (count < mincount) {
    return false;
  }

  if (offset > 0) {
    offset--;
    return false;
  }

  if (limit > 0) {
    res.add(term, count);
    limit--;
  }

  return limit <= 0;
}

